INSERT INTO `Events` (`User_id`,`Organization_id`,`Name`,`Description`,`days_of_week`,`Cyclical`,`Mode`,`Web_address`,`Tags`,`Language`,`Status`, `DateS`, `DateF`) VALUES ('9', '25', 'UX POLAND 2021', 'W tym roku mija 12 lat, odkąd eksplorujemy z Wami branżę User Experience, Service Design i Customer Experience. Każdego ro tworzymy przestrzeń, gdzie grono prelegentów (do dzisiaj blisko 300 niezwykłych specjalistów!) dzieli się z uczestnikami (ponad 4000 osób!) swoją wiedzą i doświadczeniem. W tym roku zrobimy to w odmienionej formule. Połączymy OFF-LINE i ON-LINE - dla Waszego komfortu możecie wybrać, czy przyjdziecie spotkać się z nami osobiście czy zobaczycie wszystkie wykłady z Waszej kanapy.', 'MONDAY,TUESDAY,WEDNESDAY,THURSDAY,FRIDAY,SATURDAY,SUNDAY', '1', 'online', 'https://youtube.com', 'Konferencja', 'Polski', '0', '2021-06-01 08:00:00', '2021-08-31 13:45:00');
